sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {
let visibility_condition;
let cardInstance = api.item.value.card_instance.value;
if (cardInstance.length == 32) {
	visibility_condition = false;
}
else {
  visibility_condition = true;
};

return visibility_condition;
}
